PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE dataset (
dateRep TEXT NOT NULL,
day INTEGER NOT NULL,
month INTEGER NOT NULL,
year INTEGER NOT NULL,
cases INTEGER NOT NULL,
deaths INTEGER NOT NULL,
countriesAndTerritories TEXT NOT NULL,
geoId TEXT NOT NULL,
countryterritoryCode TEXT NOT NULL,
popData2020 INTEGER NOT NULL,
continentExp TEXT NOT NULL
);
CREATE TABLE Countries (
	id INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL,
	countriesAndTerritories TEXT NOT NULL UNIQUE,
	geoId TEXT UNIQUE,
	countryCode TEXT UNIQUE,
	popData2020 INTEGER NOT NULL,
	continentExp TEXT NOT NULL
);
CREATE TABLE Dates (
	id INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL,
	dateRep TEXT NOT NULL UNIQUE,
	day INTEGER NOT NULL,
	month INTEGER NOT NULL,
	year INTEGER NOT NULL
);
CREATE TABLE CasesAndDeaths (
	date_id INTEGER,
	country_id INTEGER,
	cases INTEGER,
	deaths INTEGER,
	PRIMARY KEY (date_id, country_id),
	FOREIGN KEY (date_id) REFERENCES Dates(id)
		ON DELETE CASCADE
		ON UPDATE NO ACTION,
	FOREIGN KEY (country_id) REFERENCES Countries(id)
		ON DELETE CASCADE
		ON UPDATE NO ACTION
);
DELETE FROM sqlite_sequence;
COMMIT;
